description:
{u'_content': u'Agoura, California

Otto was a huge disappointment so WM went back to Rehrig. The EVs have been working out much better so far. We got roughly 230 carts restickered last week and called in around 40 broken ones. The Friday route is really small but we managed to get a good amount of carts done. Still got a few thousand more to resticker on another trip lol. There were so many broken UWS carts that GI ran out of WM branded carts and used a few Anderson carts as replacements!

<a href="https://www.youtube.com/watch?v=dderKou0YDA&amp;feature=youtu.be" rel="nofollow">www.youtube.com/watch?v=dderKou0YDA&amp;feature=youtu.be</a>'}

